import { motion } from "framer-motion";
import { FaGithub, FaLinkedin, FaTwitter, FaEnvelope } from "react-icons/fa";

export default function Footer() {
  const year = new Date().getFullYear();

  return (
    <motion.footer
      initial={{ opacity: 0, y: 40 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.8 }}
      className="w-full bg-gradient-to-r from-indigo-900 via-purple-800 to-indigo-900 text-gray-200 py-8 px-6 mt-10 shadow-2xl"
    >
      <div className="flex flex-col md:flex-row justify-between items-center w-full">
        {/* Brand */}
        <div className="flex flex-col items-center md:items-start gap-2">
          <h1 className="text-xl font-bold text-white">AI PR Analyzer</h1>
          <p className="text-sm text-gray-400">Â© {year} AI PR Analyzer. All rights reserved.</p>
        </div>

        {/* Socials */}
        <div className="flex gap-4 mt-4 md:mt-0">
          <a href="https://github.com" target="_blank" rel="noopener noreferrer">
            <FaGithub size={18} />
          </a>
          <a href="https://linkedin.com" target="_blank" rel="noopener noreferrer">
            <FaLinkedin size={18} />
          </a>
          <a href="https://twitter.com" target="_blank" rel="noopener noreferrer">
            <FaTwitter size={18} />
          </a>
          <a href="mailto:someone@example.com" target="_blank" rel="noopener noreferrer">
            <FaEnvelope size={18} />
          </a>
        </div>
      </div>
    </motion.footer>
  );
}
